import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M2 4.46a1 1 0 011.58-.81L8 6.77v-2.3a1 1 0 011.58-.82l5 3.53a1 1 0 010 1.64l-5 3.53A1 1 0 018 11.54v-2.3l-4.42 3.11A1 1 0 012 11.54V4.46zM8 8L3 4.46v7.08L8 8v-.02zm1 3.55L14.01 8 9 4.46v7.08z", fill: primaryFill }));
};
const FastForward16Regular = wrapIcon(rawSvg({}), 'FastForward16Regular');
export default FastForward16Regular;
